import React from "react";

const SignUp =()=>{
    return(
        <div>
            <h1>Register</h1>
            <label>Name</label>
            <input type="text "placeholder="Enter Name" />
            <label>Email</label>
            <input type="email"placeholder="Enter Email" />
            <label>Password</label>
            <input type="password "placeholder="Enter Password" />
        </div>
    )
}

export default SignUp;
